import React from "react";
import { useNavigate } from "react-router-dom";
import "./Home.css";

export default function Home() {
  const navigate = useNavigate();

  const handleLogout = () => {
    alert("Logging out...");
    navigate("/");
  };

  return (
    <div>
      <nav className="navbar">
        <div className="nav-title">MEDAWARE</div>
        <div className="nav-buttons">
          <button onClick={handleLogout}>Logout</button>
        </div>
      </nav>

      <div className="features">
        <div className="card">
          <h2>Medicine Chatbot</h2>
          <p>
            Confused about a medicine? Just enter its name into our AI-powered
            chatbot to get information like its usage, dosage, precautions, side
            effects, and whether it requires a prescription. It's quick,
            reliable, and available 24/7 to help guide patients and caregivers.
          </p>
          <button onClick={() => navigate("/chatbot")}>Chatbot</button>
        </div>

        <div className="card">
          <h2>Donate / Claim Medicines</h2>
          <p>
            Have unused or expired medicines? You can donate them for proper
            reuse or disposal. Or if you need medicines and can't afford them,
            browse through available donated items. Together, we reduce medical
            waste and support access to healthcare for all.
          </p>
          <button onClick={() => navigate("/donate")}>Donate / Claim</button>
        </div>
      </div>
    </div>
  );
}
